import React from 'react';
import { Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import '../ComponentCss/NavBar.css'; // Import CSS file

function NavBar({ loggedIn }) {
  return (
    <>
      <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand as={Link} to="/">{loggedIn ? 'THROTTLE.AI' : 'THROTTLE.AI'}</Navbar.Brand>
          <Nav className="me-auto">
            {loggedIn ? (
              <>
                <Nav.Link as={Link} to="/home">My Documentations</Nav.Link>
                <Nav.Link as={Link} to="/features">Download Extension</Nav.Link>
                <Nav.Link as={Link} to="/pricing">About</Nav.Link>
              </>
            ) : (
              <>
                <Nav.Link as={Link} to="/features">Download Extension</Nav.Link>
                <Nav.Link as={Link} to="/login">Login</Nav.Link>
                <Nav.Link as={Link} to="/register">Register</Nav.Link>
              </>
            )}
          </Nav>
        </Container>
      </Navbar>
    </>
  );
}

export default NavBar;
